import React, { Component } from 'react';

type LoginState = {
    login: boolean,
    username: string,
    password: string,
    email: string
}

export default class Login extends Component<{}, LoginState> {
    render() {
        return (
            <div>
                <h1>{this.state.login ? 'Login' : 'Register'}</h1>
            </div>
        )
    }
}
